import styled from "styled-components"

const Navbar = () => {
    return (
        <nav>
            <span>
                <a>Test 1</a>
                <a>Test 2</a>
                <a>Test 3</a>
                <a>Test 4</a>
            </span>
        </nav>
    )
}

const Nav = styled.nav`
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: space-between;
    background: green;
    height: 50px;
`;

export default Navbar
export {Navbar}
